import React from 'react'

export default function Article({article}) {



    return (
        <div>
            <div>
                Name: {article.name}
                <br />
                Picture: <img src={article.picture} />
                <br />

                Price: $ {article.price} 
                <br />
                <br />

            </div>
            <button>Add To Cart</button> 

            <button><a href={`/${article.id}`}>More Details</a></button>
        </div>
    )
}
